import { getTeamsContext } from "./dashboard/utils";
import { MainStateObject } from "./game/common/simulationState/mainSimulationState";
import { getTeamState } from "./statistics/teamDataWorkaround";
import { statsLogger } from "./tools/logger";
//return [{id : 1}, {id : 2}, {id : 3}];
const teams : {id : number, name : string, state : MainStateObject}[] = [];
getTeamsContext().forEach(team => {
  teams.push({ id : team.id, name : team.name, state : getTeamState(team.id) })
});
statsLogger.error("teams :", teams);
teams;
